import React, { useState, useEffect } from "react";
import End from "./End";
import axios from "axios";

export default function User(props) {
  const [data, setData] = useState([{}]);

  function GetOpenAPI() {
    axios
      .get(
        //URL앞에 http 붙이기
        "http://www.career.go.kr/inspct/openapi/test/questions?apikey=f96b530595b6dccabaed517667511170&q=6"
      )
      .then((response) => {
        const data = response.data.RESULT;
        // alert(data[0].question) // 자바스크립트로 요소 1개 alert 띄워보기
        // alert(JSON.stringify(data)) // 자바스크립트로 요소 전체 alert 띄워보기
        setData(data); //state 변수에 데이터 할당
      })
      .catch((e) => {
        alert(e);
      }); //오류 내용확인 예) api주소를 다르게 해서 호출하면 404에러
  }
  //html 코드가 return 된 이후에 한번만 GetOpenAPI() 함수를 호출
  useEffect(() => {
    GetOpenAPI();
  }, []);

  data.map((jsondata, idx) => {
    // 이런식으로 map함수를 사용해 html코드 안에서 반복문을 돌릴 수 있습니다.
    return (
      <>
        <div>
          {idx + 1}번 답변1: {jsondata.answer01}
        </div>
        <div>
          {idx + 1}번 답변2: {jsondata.answer02}
        </div>
        <div>
          {idx + 1}번 답변3: {jsondata.answer03}
        </div>
        <div>
          {idx + 1}번 답변4: {jsondata.answer04}
        </div>
        <br></br>
      </>
    );
  });
}
